//import logo from './logo.svg';
import './App.css';
import Guess from './guess';
import ResumeImage from './image/resume.png';


function App() {


  return (
    <div>
      <div>
        <img src={ResumeImage}  alt='resume'/>
      </div>
      <div>
        <Guess />
      </div>
    </div>
  );
}

export default App;
